2023 HAWAII 12/13 STATE CHAMP!!!
🏆🏆🏆🏆🏆🏆🏆🏆🏆🏆🏆

The saying is TRUE…it DOES take a village and I’m incredibly grateful to the one I have. First shoutout goes to @hsaoahu @hawaiianwaterpatrol @honoluluoceansafety for making this event possible and keeping the lineup safe so I could confidently surf my best. You guys are the stars!! Thank you to all the Bowls uncles who shared their lineup with all of us this week…here’s to wishing you all some EPIC 💣 s this week!! Mahalo to the judges for their time and expertise. Mahalo to the entire @hicsurf ohana for your support and sponsorship of the event. Thank you uncle @ktokorosurfboards & @abyukiko for working with me on my boards, I was 💯 confident on my equipment. Coach @katsucoriddle you are the ultimate hype man and I’m stoked to have your sandwiches and your knowledge 💪 coach @alottashibata  thank you for always keeping me on track and making sure I’m dialed in 💪 the support of my sponsors @volcomsurf @volcomwomens @hicsurf @matunas @ronin_the_tour_life @veiasupplies ensures I can keep doing what I ❤️ and I thank you ALL! Dad & Mom your my number one fans and I feel it. But I’m your number one fan, thank you for the endless list of things you do to help me pursue my passions and dreams. The competition was tuff this year, the girls are on 🔥 and I’m stoked to share the lineup with you…Congratulations @zoie.zietz @aimfortheskai & @kauanu. Moleta on FINALS! 

