I couldn’t be more honored to be selected to @hawaiisurfteam 🥳 Five years ago I won my very first surf contest… @dukekahanamokuoceanfestival where Duke groomed his athletic skills that elevated him into becoming the pioneer of “Waterman”, an @olympics Champion, and the Ambassador of Aloha. Fast forward five years and I am honored to be able to carry forward the legacy of Duke Kahanamoku as an Ambassador of Aloha on the world stage in Brazil 🇧🇷 at the @isasurfing World Junior Surfing Championships this November!! 
Thank you to the coaches @rainoshayes @alottashibata @daothercoldplayguy for your endless hours of mentoring during selection camp. I look forward to learning so much more from you and coach @shanedorian .  Thank you auntie @martinohana for your endless support of Hawaii Surf Team, mahalo @heleloamedia for capturing these images! Big love to mom and dad for their unwavering love and support. Shoutout to my team for helping me keep this dream alive! I look forward to this great journey ahead with team Hawaii! 

