Extremely bummed to end my individual run for gold here in Brazil today. Definitely one of the hardest losses that I’ve experienced so far in surfing.  I have been putting everything I have into preparing for this moment and it didn’t line up for me today. I wanted to win for myself but most of all I wanted to win for team Hawaii. It hurts.  But team Hawaii has a vision of 🥇 and I’m here to cheer them on as they shine! Competing as a team has been a new experience for me. Old friendships have deepened, unexpected ones have flourished and new ones were made.  I want to give a giant thank you to every person that has supported this dream in any way.  I am leaving Brazil 🇧🇷 with a heart full of gratitude for all the experiences (also the açaí) and a giant smile! 

